import React from 'react';
import { useNavigate } from 'react-router-dom';
import Card from './Card';

export default function SGODashboard() {
  const navigate = useNavigate();

  const addCSOPage = () => {
    navigate('/addCSO');
  };

  const cards = () => (
    <>
      <Card imageUrl="path/to/students.jpg" description="Students" />
      <Card imageUrl="path/to/executives.jpg" description="Executives" />
      <Card imageUrl="path/to/csos.jpg" description="CSOs" />
    </>
  );

  return (
    <main>
      <h1>SGO Dashboard</h1>
      <p>
        Welcome, SGO member! Here you can manage clubs, approve events, and view
        student activities.
      </p>
      <button onClick={addCSOPage}>Add CSO</button>

      {cards()}
    </main>
  );
}
